function Child() {
    const data = [
        {
            state: "Uttar Pradesh",
            capital: "Lucknow",
            language: ["English", "Arab","French"],
        },
        {
            state: "Gujarat",
            capital: "Gandhinagar",
            language: ["English","Portugese", "French"],
        },
        {
            state: "Karnataka",
            capital: "Bengaluru",
            Language: ["English","Chinese", "French"],
        },
        {
            state: "Punjab",
            capital: "Chandigarh",
            Language: ["English","Italian", "French"],
        },
        {
            state: "Maharashtra",
            capital: "Mumbai",
            Language: ["English","Japanese", "French"],
        }
    ]
    const listItems = data.map(
        (element) => {
            return (
                <ul type="disc">
                    <li style={{ 
                        fontWeight: 'bold', 
                        color: 'red' }}
                    >
                        {element.State}
                    </li>
                    <li>{element.Capital}</li>
                    <li>{element.Language}</li>
                </ul>
            )
        }
    )
    return (
        <div>
            {listItems}
        </div>
    )
  }

  export default Child
